function Home() {
     return ( 
        <div className="navBar"> 
            <h1 className="glitch-title cyber-btn-h1">
        {/* The text for normal display */}
        <span>Gde sad</span> 
        {/* The element for the glitch effect on hover */}
        <span className="glitch">Gde sad</span>
      </h1>
        </div> 
        ) 
    } 
    export default Home
